THE ALEX JONES SHOW
2009.03.30 Monday

Alex talks with Karen Russo, the founder and director of The Wrongful Death &amp; Injury Institute. Alex also welcomes in-studio Webster G. Tarpley, author of Obama: The Postmodern Coup, and talks with Infowars producers Rob Dew and Jason Douglass who will call-in with a live report from the homeless camp in California. Luke Rudkowski and Manny Valencia talk with Alex about their arrest in New York. Alex also discusses the issues of the day and takes your calls. 

HR 1: News, Webster Tarpley, economics &amp; politics
HR 2: Webster Tarpley
HR 3: Webster Tarpley, On line w/Luke Rudkowski, Rob Dew &amp; Jason Douglass
